import React from "react";
import {Link} from 'react-router-dom'

const Continents = ()=>{
    let continents = [
        {name : 'Africa' , img : './imges/africa.jpg', path: '/'},
        {name : 'The Americas' , img : './imges/north-america.jpg', path: '/'},
        {name : 'Asia' , img : './imges/asia.jpg', path: '/'},
        {name : 'Europe' , img : './imges/Europe.jpg', path: '/'},
        {name : 'Australia' , img : './imges/Australia.jpg', path: '/'},
        {name : 'Antarctica - Oceania' , img : './imges/Antarctica.jpg'},


    ]
    return(
        <div className="continents ">
            <div className="cont-card">
                {continents.map(con=>{
                    return(
                        <div className="card">
                            <Link to={'/Africa'}><h3>{con.name}</h3></Link>

                            <img src={con.img} alt='map' width='200px'/>
                        </div>
                    )
                })}
            </div>
        </div>
    )
}

export default Continents
